import React from "react";
import AddContact from "../components/AddContact";
import ContactList from "../components/ContactList";

const Home = ({
  contacts,
  setContacts,
  addContactHandler,
  removeContactHandler,
}) => {
  return (
    <div>
      <AddContact
        contacts={contacts}
        setContacts={setContacts}
        addContactHandler={addContactHandler}
      />
      <ContactList />
    </div>
  );
};

export default Home;
